const findTheDifference1 = function (s, t) {
    return String.fromCharCode([...s, ...t].reduce((acc, c) => {
        return acc ^ c.charCodeAt(0);
    }, 0))
};
console.log(findTheDifference1("abcd", "abcde")) // e
console.log(findTheDifference1("", "y")) // y

const findTheDifference2 = function (s, t) {
    const sMap = new Map();
    for (let i of s) {
        if (sMap.has(i)) {
            sMap.set(i, sMap.get(i) + 1)
        } else {
            sMap.set(i, i)
        }
    }
    for (let i of t) {
        if (sMap.has(i)) {
            sMap.set(i, sMap.get(i) - 1)
            if (sMap.get(i) === -1) {
                return i;
            }
        } else {
            return i;
        }
    }
    return '';
};
console.log(findTheDifference2("abcd", "abcde")) // e
console.log(findTheDifference2("", "y")) // y


const findTheDifference3 = function (s, t, i = 0) {
    if (s.length === t.length) return;
    while (s.length < t.length) {
        if (s[i] === undefined || t[i] === undefined) return;
        else if (s[i] !== t[i]) return t[i]
    }

};
console.log(findTheDifference3("abcd", "abcde")) // e
console.log(findTheDifference3("", "y")) // y
console.log(findTheDifference3(
    "", "")) // t



var findTheDifference = function (s, t) {
    let sL = s.split('').sort();
    let tL = t.split('').sort();
    if (sL.length == tL.length) return;
    while (sL.length < tL.length) {
        for (let i = 0; i < tL.length; i++) {
            if (sL[i] !== tL[i])
                return tL[i];
        }
    }
};
console.log(findTheDifference(
    "", "")) // t


var findTheDifference = function (s, t) {
    const cache = {};
    for (const char of s) {
        if (!cache[char]) {
            cache[char] = 0;
        }
        cache[char]++;
    }
    for (const char of t) {
        if (!cache[char]) {
            return char;
        }
        cache[char]--;
    }
};